@bob_rylander @Annabosdotter @GreiderDD Inte säkert att publiciteten runt Adaktussons 22 knapptryckningar gynnade KD i EU-valet - hade nog gått bättre utan den

Håller med dej f ö - minaretupproret, helgskinkan, 
100 000 våldtäkter mm har nog mer funkat som uppmärksamhetsdjippon a la Trump.

Men inte så konstigt att EU-valet blev ett nytt jätteras för Socialdemokraterna i Sollefteå kommun: minus 938 röster, 13 procent. Dock orsakas det inte av partiet lokalt utan i länet/regionen (landstinget).
Länets S-riksdagslista toppades av Löfven.
@socialdemokrat

