@GroningLotta Det som gör folk mest upprörda är det ständiga falskspelet.

Ingen gång före riksdagsvalet var en S-reg ett alternativ för Annie Lööf, fast det var plan b. C skulle förlorat väljare om de varit ärliga.

Samma visa innan EU-valet. Inga besked om Strandhäll, pga röstmaximering.

@bjornhakansson @Centerpartiet beslut att inte rösta mot @strandhall var nog fattat redan före EU-valet, men man avvaktar med offentliggörande av strategiska skäl. Det finns ju några som tror att C är borgerligt.

Undar vad @annieloof fått i gengäld av @socialdemokrat .
